INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 190801, "カリン", 2, 1000001, 3.414, -416.5, 1, 62, "2030/01/01 14:59:59", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", "2025/01/31 12:00:00", 1, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 190801, "カリン", 2, 1000002, 3.099, -416.5, 1, 62, "2030/01/01 14:59:59", "ミッションをクリアして、\n報酬をゲットしましょう！", "2025/01/31 12:00:00", 2, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 190801, "カリン", 2, 1000003, 2.801, -416.5, 1, 63, "2030/01/01 14:59:59", "受け取ることができる\n報酬があるようです\n確認してみてください", "2025/01/31 12:00:00", 3, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 190801, "カリン", 2, 1000004, 0.0, -416.5, 1, 63, "2030/01/01 14:59:59", "報酬がもらえますよ！\nチェックしてみてください", "2025/01/31 12:00:00", 4, 2);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 190801, "カリン", 1, 1000005, 2.12, -363.0, 1, 64, "2030/01/01 14:59:59", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "2025/01/31 12:00:00", 5, 2);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 190801, "カリン", 2, 1000006, 1.68, -363.0, 1, 64, "2030/01/01 14:59:59", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", "2025/01/31 12:00:00", 6, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 190801, "カリン", 1, 1000007, 2.33, -363.0, 1, 64, "2030/01/01 14:59:59", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "2025/01/31 12:00:00", 7, 2);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-6.0, 133701, "ラビリスタ", 7, 1020101, 5.18, -285.0, 10201, 61, "2030/01/01 14:59:59", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "2025/01/31 12:00:00", 101, 3);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-2.0, 133901, "クリスティーナ", 2, 1020102, 8.77, -285.0, 10201, 61, "2030/01/01 14:59:59", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "2025/01/31 12:00:00", 201, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 133801, "ネネカ", 1, 1020103, 15.5, -285.0, 10201, 61, "2030/01/01 14:59:59", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "2025/01/31 12:00:00", 301, 6);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 134301, "ランファ", 5, 1020201, 9.061, -285.0, 10202, 61, "2030/01/01 14:59:59", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "2025/02/28 12:00:00", 101, 2);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 134401, "チカ", 2, 1020202, 7.699, -285.0, 10202, 61, "2030/01/01 14:59:59", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "2025/02/28 12:00:00", 201, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 134601, "アオイ", 2, 1020301, 8.595, -285.0, 10203, 61, "2030/01/01 14:59:59", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "2025/03/31 12:00:00", 101, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 134501, "クローチェ", 2, 1020302, 7.758, -285.0, 10203, 61, "2030/01/01 14:59:59", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "2025/03/31 12:00:00", 201, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 132302, "ルイズマリー", 6, 1020401, 7.0, -285.0, 10204, 61, "2030/01/01 14:59:59", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "2025/04/30 12:00:00", 101, 2);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 132402, "イロハ", 2, 1020402, 7.904, -285.0, 10204, 61, "2030/01/01 14:59:59", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "2025/04/30 12:00:00", 201, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 132502, "ソノ", 2, 1020403, 8.487, -285.0, 10204, 61, "2030/01/01 14:59:59", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "2025/04/30 12:00:00", 301, 4);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 134901, "カノン", 2, 1020502, 8.763, -285.0, 10205, 61, "2030/01/01 14:59:59", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", "2025/05/31 12:00:00", 101, 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 134801, "ツムギ", 3, 1020503, 6.417, -285.0, 10205, 61, "2030/01/01 14:59:59", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", "2025/05/31 12:00:00", 201, 1);
